import React from "react";
import { Line } from "react-chartjs-2";

class Chart extends React.component {
  render() {
    return (
      <Line
        data={data}
        width={100}
        height={50}
        options={{
          maintainAspectRatio: false
        }}
      />
    );
  }
}
export default Chart;
